import React from 'react';

function Header({ onLogout }) {
  return (
    <header className="bg-gradient-to-r from-blue-800 to-blue-900 text-white py-4 px-6 flex justify-between items-center shadow-md">
      <h1 className="text-xl font-bold tracking-wide">
        Autonomous Security Auditor Agents Application
      </h1>
      <button
        onClick={onLogout}
        className="bg-red-600 hover:bg-red-700 text-white font-semibold px-4 py-2 rounded shadow-md transition duration-200"
      >
        Logout
      </button>
    </header>
  );
}

export default Header;
